import React from "react";
import { NavLink } from "react-router-dom";
const Navbar = () => {
  return (
    <>
      <NavLink to="/">Home</NavLink>
      <NavLink to="/about">Homeabout</NavLink>
      <NavLink to="/service">Homeservice</NavLink>
    </>
  );
};

export default Navbar;
